style.css:
ytd-thumbnail {
        position: relative;
    }

    /* Add animated Maxwell GIF overlay to each thumbnail */
    ytd-thumbnail::after {
        content: "";
        background: url("https://media.tenor.com/qJRMLPlR3_8AAAAi/maxwell-cat.gif") no-repeat center center;
        background-size: cover;
        position: absolute;
        top: 0;
        left: 0;
        width: 40%;
        height: 40%;
        pointer-events: none;
    }
